import PokeAPI from '../../api/PokeAPI';
import React, {useState, useEffect} from 'react';

const PokemonList =  () => {
const {pokemonData} = props;

  return(
   <ul className={classes.list}>
     {pokemonData?.results.map((pokemon)=>(
       <li>
        {pokemon.name}
        </li>
      ))}
   </ul>
  )
}

